import Header from './Header';
import Footer from './Footer';
import css from '../static/scss/style.scss';
const Layout = ({children}) => {
    return (
        <React.Fragment>
            <Header/>
            <p className="example">Test</p>
            {children}
            <Footer/>
        </React.Fragment>
    )
}

export default Layout;
